import React from 'react';
import '../App.css';
import './Dashboard.css';
import logo from '../Logo.png'
import FileUpload from '../components/FileUpload';


function Dashboard() {
  return (
    <div className='background'>
        <div className="menu">
          <div>
            <img src={logo} alt="logo"/>
            <h1>SkillSage</h1>
          </div>
        </div>

        <div className='upload-btn-container'>
          <FileUpload />
          <div><h3 className='sizeLabel'>Max size: </h3><h3 className='unlimited'>Unlimited</h3></div>
          <h3>Supported files types: JPG, PNG, PDF, DOCX, PPTX</h3>
        </div>
    </div>
  )
}

export default Dashboard
